$(document).ready(function(){$("body").on("fileActionEvent",function(a,b){if(b.obj.hasClass("hexdump")){var d=ToolBox.blockPage();var c=$.get(window.location.pathname,{action:"hexdump",file:b.file},function(e){d.remove();var f=$(e);$(".hexdump",f).css({"max-height":Math.max(Math.floor($(window).height()*0.8),200)+"px",overflow:"auto","padding-right":"2em"});f.dialog({width:"auto",height:"auto",dialogClass:"hexdump",closeText:$("#close").html()})});ToolBox.renderAbortDialog(c)}})});